typedef void SnackbarActionHandler();

class SnackbarOptions {
  String message;
  int timeout;
  SnackbarActionHandler actionHandler;
  String actionText;
  bool multiline;
  bool actionOnBottom;

  SnackbarOptions({this.message, this.timeout, this.actionHandler, this.actionText,
                   this.multiline, this.actionOnBottom});
}

@VueComponent(template: r'''
<m-snackbar
  v-on="$listeners"
  :theming="theming"
  ref="inner"
  :alignStart="alignStart"
  :dismissesOnAction="dismissesOnAction"
  :open="open"
  :options="_options"
>
</m-snackbar>''')
class MSnackbar extends VueComponentBase with BaseMixin {
  MSnackbar() { _initialize(); }
  @override
  void lifecycleCreated() {
  }
  @ref
  dynamic inner;
  @prop
  bool alignStart = false;
  @prop
  bool dismissesOnAction = true;
  @prop
  bool open = false;
  @prop
  SnackbarOptions options;
  @computed
  dynamic get _options => mapToJs({
      'message': options?.message,
      'timeout': options.timeout,
      'actionHandler': options?.actionHandler != null
                        ? allowInterop(options.actionHandler) : null,
      'actionText': options?.actionText,
      'multiline': options?.multiline,
      'actionOnBottom': options?.actionOnBottom,
    });
}
